# Define a function that compares the two individuals' compliance with information security policies using the following criteria:
# - The individual's statement about their views on security protocols. 
# - The individual's views on the importance of safeguarding their organization's resources. 
# - The individual's willingness to comply with their organization's security policies. 

def compare_compliance(individual1, individual2):
  # Use a scoring system from 1 to 5 for each criteria, where 1 is the least compliant and 5 is the most compliant. 
  # Add up the scores for each individual.
  score1 = 0
  score2 = 0
  # Check if the first criterion matches
  if "The individual views following Information Security Policies as mandatory, rather than optional." in individual1:
    score1 += 5
  elif "The individual is aware and willing to comply with their organization's security policies." in individual1:
    score1 += 4
  else:
    score1 += 3
  # Check if the second criterion matches
  if "The individual views adherence to the organization's security regulations as a mandatory task." in individual2:
    score2 += 5
  elif "The person warned of potential harm if not following security policies. The person highly values following the institution's Information Security Policies." in individual2:
    score2 += 4
  else:
    score2 += 3
  # Check if the third criterion matches
  if "The individual is willing to comply with their organization's security policies" in individual1:
    score1 += 5
  elif "The person highly values following the institution's Information Security Policies." in individual1:
    score1 += 4
  else:
    score1 += 3
  # Return the individual with the higher score as the most compliant. If the scores are equal, return None.
  if score2 > score1:
    return (individual2)
  elif score2 < score1:
    return (individual1)
  else:
    return (None)

